import React from "react";
import Article from "../../../UI/Article/Article";

export default function() {
    return (
        <Article>
            <h3>Mitmachen</h3>
            <p>
            Sie finden uns in der "Heinrich-Beslmeisl-Halle" in der Holzhamer Straße 6. Über den
            Seiteneingang im Angerweg kommen Sie über die Treppe in den Keller zu uns.
            </p>
            <p>Von Oktober bis Ostern schießen wir regelmäßig Freitags.</p>
            <p>- Schüler und Jugendliche ab 17:30 Uhr</p>
            <p>- Schützen ab 19:00 Uhr</p>
            <p>Neulinge und solche, die es werden wollen, sind immer Willkommen</p>
        </Article>
    )
}
